#include <assert.h>
#include <stdint.h>
#include <stdio.h>
#include <stdbool.h>
#include <stdlib.h>
#include <string.h>
#include <raylib.h>
#define RAYGUI_IMPLEMENTATION
#define RAYGUI_CUSTOM_ICONS
#include <icons.h>
#include <raygui.h>
#include <style_dark.h>
#include <omp.h>
#define STB_DS_IMPLEMENTATION
#include <stb_ds.h>

#include "../../include/game/arrow_type.h"
#include "../../include/game/chunk.h"
#include "../../include/game/signal_type.h"
#include "../../include/core/main.h"

#include <pthread_time.h>

#include "../../include/core/settings.h"
#include "../../include/game/map.h"
#include "../../include/game/point.h"
#include "io/input.h"

double now(void) {
    struct timespec ts;
    clock_gettime(CLOCK_MONOTONIC, &ts);
    return (double) ts.tv_sec + ts.tv_nsec * 1e-9;
}

int main(int argc, char** argv) {
    const int MAX_NUMBER_OF_THREADS = omp_get_max_threads();
    settings_t settings = { 0 };
    map_t map = { 0 };
    map_import(&map, "");

    set_theme(&settings, false);
    settings.target_fps = 60;
    settings.target_tps = 1;
    settings.zoom = DEFAULT_ZOOM;
    set_num_threads(&settings, MAX_NUMBER_OF_THREADS);

    InitWindow(1900, 1000, "Arrows");
    SetWindowState(FLAG_WINDOW_RESIZABLE);
    const Image icon = LoadImage("icon.png");
    SetWindowIcon(icon);
    UnloadImage(icon);

    const Texture atlas_dark = LoadTexture("atlas_dark.png");
    const Texture atlas = LoadTexture("atlas.png");

    SetTargetFPS(settings.target_fps);
    int tps = 0;
    int tick = 0;
    double tps_acc = 0.0;
    double prev_time = now();
    while(!WindowShouldClose()) {
        tps_acc += now() - prev_time;
        prev_time = now();
        if (tps_acc > 0.5)
        {
            tps_acc = 0.0;
            tps = tick * 2;
            tick = 0;
        }
        assert(settings.palette != NULL && "Palette not set!");
        BeginDrawing();
        ClearBackground(GetColor(GuiGetStyle(0, BACKGROUND_COLOR)));
        const Rectangle viewRect = {
            .x = settings.camera_position.x,
            .y = settings.camera_position.y,
            .width = (float)GetScreenWidth() / settings.zoom,
            .height = (float)GetScreenHeight() / settings.zoom
        };
        for(size_t i = 0; i < hmlen(map.chunks); i++) {
            int chunk_x = map.chunks[i].key.x;
            int chunk_y = map.chunks[i].key.y;
            const Rectangle chunkRect = {
                .x = (float)(chunk_x * CHUNK_SIZE),
                .y = (float)(chunk_y * CHUNK_SIZE),
                .width = (float)CHUNK_SIZE,
                .height = (float)CHUNK_SIZE
            };
            if (!CheckCollisionRecs(viewRect, chunkRect)) {
                continue; // Переходим к следующему чанку
            }
            chunk_t *chunk = map.chunks[i].value;
            for(size_t j = 0; j < CHUNK_SIZE*CHUNK_SIZE; j++) {
                arrow_t *arrow = &chunk->arrows[j];
                if(arrow->type == AR_EMPTY) continue;
                int arrow_x = j % CHUNK_SIZE;
                int arrow_y = j / CHUNK_SIZE;
                arrow_x += chunk_x*CHUNK_SIZE;
                arrow_y += chunk_y*CHUNK_SIZE;

                Rectangle dest_rect = (Rectangle) {
                    .width = settings.zoom,
                    .height = settings.zoom,
                    .x = (arrow_x*settings.zoom-settings.camera_position.x*settings.zoom),
                    .y = (arrow_y*settings.zoom-settings.camera_position.y*settings.zoom)
                };
                Rectangle source_rect = (Rectangle) {
                    .x = ((arrow->type-1) % 8) * 256.0,
                    .y = (int)((arrow->type-1) / 8) * 256.0,
                    .width = arrow->flipped ? -256 : 256,
                    .height = 256,
                };
                if (arrow->signal != S_NONE) {
                    DrawRectangleV((Vector2){dest_rect.x - settings.zoom/2, dest_rect.y - settings.zoom/2}, (Vector2){ settings.zoom, settings.zoom }, get_signal_color(&settings, arrow->signal));
                }
                DrawTexturePro(settings.dark_theme ? atlas_dark : atlas, source_rect, dest_rect, (Vector2){ settings.zoom/2, settings.zoom/2 }, DIR2DEG[arrow->direction], WHITE);
            }
        }
        if (settings.target_tps == 1)
        {
            const double start = now();
            while (now() - start < 0.0166666)
            {
                for(size_t j = 0; j < 10; j++) {
                    map_update_single(&map);
                    map_update_single(&map);
                    map_update_single(&map);
                    map_update_single(&map);
                    map_update_single(&map);
                }
                tick += 50;
            }
        } else {
            for(size_t j = 0; j < settings.target_tps / 60.0 && !settings.pause; j++) {
                map_update_single(&map);
            }
            tick += (int) settings.target_tps / 60;
        }
        // ---- GUI ----
        // TODO: unhardcode sizes
        DrawRectangle(0, 0, 100, 50, ColorAlpha(GetColor(GuiGetStyle(0, BACKGROUND_COLOR)), UI_BACKGROUND_ALPHA));
        DrawFPS(10, 10);
        DrawText(TextFormat("TPS: %i", tps), 10, 40, 10, BLACK);
        int theme_button = GuiButton((Rectangle){ .x = GetScreenWidth()-100, .y = 0, .width = 100, .height = 50 }, GuiIconText(settings.dark_theme ? ICON_MOON : ICON_SUN, "Theme"));
        if (theme_button) {
            set_theme(&settings, !settings.dark_theme);
            if (settings.dark_theme) {
                GuiLoadStyleDark();
            } else {
                GuiLoadStyleDefault();
            }
        }
        DrawRectangle(GetScreenWidth(), GetScreenHeight(), -250, -40, ColorAlpha(GetColor(GuiGetStyle(0, BACKGROUND_COLOR)), UI_BACKGROUND_ALPHA));

        float slider = (float) settings.num_of_threads;
        GuiSlider( (Rectangle) { (float) GetScreenWidth() - 100, (float) GetScreenHeight() - 20, 100, 20 },
            GuiIconText(ICON_CPU, TextFormat("Number of threads: %d", settings.num_of_threads)),
            "", &slider, 1.0f, (float) MAX_NUMBER_OF_THREADS);

        if ((int) slider != settings.num_of_threads) {
            set_num_threads(&settings, (int) slider);
        }

        GuiSlider((Rectangle) { (float) GetScreenWidth() - 100, (float) GetScreenHeight() - 40, 100, 20},
            GuiIconText(ICON_CLOCK, TextFormat("TPS: %.3f", settings.target_tps)),
            "", &settings.target_tps, 1, MAX_TPS);

        handle_input(&settings, &map);
        EndDrawing();
    }

    UnloadTexture(atlas_dark);
    UnloadTexture(atlas);
    CloseWindow();
    map_clear(&map);

    return 0;
}
